DROP DATABASE IF EXISTS books;

CREATE DATABASE books;

USE books;

DROP TABLE IF EXISTS `book`;
CREATE TABLE `book` (
  `id` int(11) NOT NULL,
  `title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `descrption` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `isbn` varchar(13) COLLATE utf8_unicode_ci DEFAULT NULL,
  `authorname` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `authorlastname` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `publishername` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `publisheraddr` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cover` blob DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `isbn` (`isbn`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


